import React from "react";
import { ListGroup } from "react-bootstrap";
import "./EnemyList.css";

const EnemyList = ({ enemyTracker }) => {
  return (
    <>
      {enemyTracker &&
        enemyTracker.map((enemy) => <ListGroup action variant="light">{enemy}</ListGroup>)}
    </>
  );
};

export default EnemyList;
